# Convertir sql_inserts a cadena de texto
sql_inserts = ''.join(sql_inserts)

# Eliminar encabezados y pie del insert SQL
sql_inserts = sql_inserts.replace("INSERT INTO `pokemon` (`id`, `name`, `weight`, `height`, `hp`, `atk`, `def`, `satk`, `sdef`, `spe`, `sprite`) VALUES", "")
sql_inserts = sql_inserts.strip().strip('()')

# Dividir el insert en inserts individuales
individual_inserts = sql_inserts.split('),')

pokemon_objects = []

for insert in individual_inserts:
    data = insert.strip().strip('()').split(',')  # Dividir los valores por comas
    name = data[1].strip().strip("'")
    weight = int(data[2])
    height = int(data[3])
    hp = int(data[4])
    atk = int(data[5])
    def_stat = int(data[6])
    satk = int(data[7])
    sdef = int(data[8])
    spe = int(data[9])
    sprite = data[10].strip().strip("'")
    pokemon_objects.append(Pokemon(name, weight, height, hp, atk, def_stat, satk, sdef, spe, sprite))

# Guardar los datos de cada Pokemon en un archivo de texto
with open("pokemon_data.txt", "w") as file:
    for pokemon in pokemon_objects:
        file.write(f"pokemon = Pokemon(name='{pokemon.name}', weight={pokemon.weight}, height={pokemon.height}, hp={pokemon.hp}, atk={pokemon.atk}, def_stat={pokemon.def_stat}, satk={pokemon.satk}, sdef={pokemon.sdef}, spe={pokemon.spe}, sprite='{pokemon.sprite}')\n")
        file.write("pokemon.save()\n")

print("Datos guardados correctamente.")
